import React from "react";
import "./styles/Navbar.css";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar__title">
        <h1>Shopping Cart</h1>
      </div>

      <div className="navbar__links">
        <ul>
          <li>Home</li>
          <li>Shop</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
